import NavigationLink from './NavigationLink';
import appConfig from '../app.config';


let SubHeader = () => {
	return (
		<div className="tabs">
			<NavigationLink
				linkList={appConfig.subNavLink}
				type="li"
			/>
			<ul className="is-pulled-right">
				<li><a>TEST network</a></li>
				<li>0xf2f1f7BdB3EB2120faf1d02e1b20FF822B6Fd442</li>
			</ul>
		</div>
	)
}


export default SubHeader;
